function str = genname(varargin)
% genname
% 
% Description:	generate a random name
% 
% Syntax:	str = genname(<options>)
% 
% In:
% 	<options>:
%		first:	(1) the number of first names
%		middle:	(0) the number of middle names
%		last:	(1) the number of (hyphenated) last names 
% 
% Out:
% 	str	- the name
% 
% Updated: 2014-02-02
% Copyright 2014 Alex Schlegel (schlegel@gmail.com).  This work is licensed
% under a Creative Commons Attribution-NonCommercial-ShareAlike 3.0 Unported
% License.
persistent sData;

opt	= ParseArgs(varargin,...
		'first'		, 1	, ...
		'middle'	, 0	, ...
		'last'		, 1	  ...
		);

if isempty(sData)
	sData	= NameData;
end

strFirst	= join(arrayfun(@(n) GenFirst,1:opt.first,'uni',false),' ');
strMiddle	= join(arrayfun(@(n) GenMiddle,1:opt.middle,'uni',false),' ');
strLast		= join(arrayfun(@(n) GenLast,1:opt.last,'uni',false),'-');

cName							= {strFirst strMiddle strLast};
cName(cellfun(@isempty,cName))	= [];

str	= join(cName,' ');


%------------------------------------------------------------------------------%
function str = GenFirst
	str	= GenName(3,8);
end
%------------------------------------------------------------------------------%
function str = GenMiddle
	str	= GenName(3,8);
end
%------------------------------------------------------------------------------%
function str = GenLast
	str	= GenName(2,13);
end
%------------------------------------------------------------------------------%
function str = GenName(lenMin,lenMax)
	%name length
		len	= randFrom(lenMin:lenMax);
	%first letter
		str	= ChooseFrom(sData.first.chr, sData.first.freq);
	%second letter
		str(end+1)	= ChooseFrom(sData.second.(str).chr, sData.second.(str).freq);
	%choose the rest
		for k=1:len-2
			d			= sData.next.(str(end-1)).(str(end));
			str(end+1)	= ChooseFrom(d.chr,d.freq); 
		end
	
	str	= [upper(str(1)) str(2:end)];
end
%------------------------------------------------------------------------------%
function chr = ChooseFrom(chr,freq)
	%total occurrences
		total	= sum(freq);
		
		if total==0
			if isempty(chr)
				chr	= randFrom('a':'z');
			else
				chr	= randFrom(chr);
			end
			
			return;
		end
	%choose a position in the distribution
		target	= randi(total);
	%find the value associated with the position
		current	= 0;
		kChr	= 0;
		while current < target
			kChr	= kChr + 1;
			current	= current + freq(kChr);
		end
	
	chr	= chr(kChr);
end
